import SetContext from '../context/SetContext/SetContext';


const Set = ({match}) => {

    const setContext = useContext(SetContext);

    const CleanParams = () => {
        const param = match.params.setname
        const dashregex = /-/gi;
        const tilderegex = /~/gi;
        if (dashregex.test(param) && tilderegex.test(param) === false) {
            const replacedash = param.replaceAll(dashregex, ' ')
            return replacedash
        }
    }
    
    useEffect(() => {
       setContext.GetSet(CleanParams())
